Estudo - Religious Trump Voters: How Faith Moderates Attitudes about Immigration, Race, and Identity - 2019

Conclusões:
 - A noção de identidade racial por parte dos republicanos torna-se menos evidente para os mesmos quanto mais regularmente frequentam a igreja;
 - As opiniões dos republicanos sobre as minorias étnicas melhoram à medida que os mesmos frequentam serviços religiosos com maior regularidade;
 - Os republicanos ateus possuem uma probabilidade 3x maior em comparação aos republicanos religiosos que frequentam a igreja regularmente de afirmar que a sua identidade racial branca é extremamente importante;

São estudos como este que demonstram o que já é verificável em Portugal, nomeadamente a forte correlação entre o cristianismo e o anti-racismo.
